import "./App.css";
import MainDisplay from "./components/MainDisplay/MainDisplay";
import './App.css'
import LogIn from "./components/login/login";
import Register from "./components/login/register";
import { BrowserRouter as Router , Routes, Route, Link } from "react-router-dom";
import Clothes from "./components/ItemsComponents/clothingItems/ClothingItems";
import { createClient } from 'pexels';



function App() {

let url;

const client = createClient('yEVq5RAVSwexgrfJsXr9WNlqKQX66Sg1gLHHXFAR2zbixFsFLMqVz6ZG');


const query = 'shoes';

client.photos.search({ query, per_page: 1 }).then(photos => {
    url = photos.photos[0].src.original

})



  return(
  <>
  <div className='contain'>
  <Router>
    <Routes>
      <Route exact path='/' element={<LogIn/>}></Route>
      <Route exact path='/Register' element={<Register/>}></Route>
      <Route exact path='/MainPage' element={<MainDisplay/>}></Route>
      <Route path='MainPage/Items/Clothingitems' element={<Clothes/>}></Route>
    </Routes>
  </Router>
  </div>

  </>)

}

export default App;
